(1, 2, 'Senior .Net Developer', 'Minimum 4 Years’ experience in web development\nExtensive experience Asp .NET MVC, Core MVC, ASP.NET Webforms\nStrong understanding of web and micro services, e.g. REST, JSON/XML-RPC, SOAP, JWT, etc.\nFamiliar with backend technologies, e.g. SQL Server, CDN, etc.\nFamiliar with scripting tools like Gruntjs, GulpJs, Npm, etc.\nFamiliar with responsive web designs.\nFamiliar with front-end testing tools with be an advantage.\nExperience with leading a team would be an advantage.', 'English', 2, 'Work with other highly skilled developers to build rich and responsive interfaces applications for web and mobile.\nOptimize existing applications, services and components\nProvide input for project milestones, schedules, QA testing in an agile development environment.\nDesign, document and implement reusable frameworks and libraries.\nMentor team member’s skills that improve team efficiency and proficiency.\nManage and communicate project tasks and priority; ensuring high team productivity.', 'Jakarta', 5, 0, NULL, 1, '2021-06-15 08:37:14', '2021-06-15 08:42:44', NULL),
(2, 1, 'Product Specialist', '', 'English', 1, 'Full understanding of the product features, limitation and provide the necessary support to business users\nOrganise and present product demonstrations with prospective clients.\nAttend meetings with partners and eventually take ownership of this process.\nAfter-sales support.\nParticipate in project proposals and tender responses to provide product details, architecture and necessary documentation.\nAttend meetings with partners and eventually take ownership of this process.\nLog missing information and ensure that our internal and client-facing product catalogues, knowledge bases are always up to date.\nAbility to identify the root cause of the problem, bugs.\nResourceful in finding the answers to the problem, familiar with various tech support forum like stackoverflow, github etc for answers.\nEscalate bugs and feature requests to product team and oversee the product fixing process.', '', 0, 0, '-', 1, '2021-06-15 08:58:31', '2021-06-24 09:43:21', NULL),
(3, 2, '.Net Developer', '', 'France', 1, 'Work with other highly skilled developers to build rich and responsive interfaces applications for web and mobile. Optimize existing applications, services and components Provide input for project milestones, schedules, QA testing in an agile development environment. Design, document and implement reusable frameworks and libraries. Mentor team member’s skills that improve team efficiency and proficiency. Manage and communicate project tasks and priority; ensuring high team productivity.', '', 0, 0, 'Up from Salary Expectaction', 1, '2021-06-16 04:45:01', '2021-06-24 09:46:16', NULL),
(4, 3, 'DIRECT RESPONSE COPYWRITER', '', 'English', 0, '* Ad Angle Creation\n\n* Regularly churning out ad ideas and creatives to test for multiple campaigns\n\n* Giving suggestions and tweaking ad creatives(video/images) for team to make adjustments\n\n* Doing due diligence research on (i) target market (ii)product (iii)offer (iv) competitors\n\n* Sourcing for external ideas that would help campaign marketing angles\n\nCopywriting\n\n* Churning out ad copies for each creatives for all ad platforms\n\n* Coming up with captions for images or video text overlays\n\n* Writing and tweaking landing page copies to improve performance\n\n* Research on psychological emotions behind each client\'s target market\n\nAd Maintenance\n\n* Creation of ads with copy given to launch on Facebook/Youtube\n\n* Monitoring of ads and making sure there is no overspend\n\n* Scaling up of the budget if results is ideal', '', 0, 1, 'Below Expectation', 1, '2021-06-16 04:53:55', '2021-06-16 04:53:55', NULL),
(5, 2, 'Manager', '', 'Indonesia', 2, 'manage', 'Jakarta', 0, 0, 'RP. 17.000.000 - Rp. 20.000.000', 1, '2021-06-23 02:45:28', '2021-06-23 02:45:42', '2021-06-23 02:51:51');

